import React from "react";
import Image from "./Image";

const Gallery = (props) => {
  return (
    <div id="portfolio" className="text-center py-10">
      <div className="container mx-auto px-4">
        <div className="section-title mb-8">
          <h2 className="text-3xl font-semibold mb-2">Gallery</h2>
          <p className="text-gray-600">
            Explore our stunning makeup transformations, from bridal elegance to party glam.
          </p>
        </div>

        {/* Responsive grid */}
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
          {props?.data
            ? props?.data.map((item, index) => (
                <Image key={index} smallImage={item.smallImage} />
              ))
            : "Loading..."}
        </div>
      </div>
    </div>
  );
};

export default Gallery;
